import React from "react";
import "./App.css";
import MainComp from "./MainComp";
import {Route, Routes} from "react-router-dom";
export default function App(){
    return(
        <>
        <Routes>
          <Route exact path='/' element={<MainComp />}/>
            
        </Routes>

        </>
    );
}
